import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { render } from 'react-dom';
import Konva from 'konva';
import { Stage, Layer, Star, Text, Rect,Util } from 'react-konva';
import Mundo from './componentes/Mundo';

class App extends Component {


  render() {
    const rects = [{
                width: 100,
                height: 200,
                x: 3,
                y: 100,
                fill: 'red',
                radius: 20
            },
            {
                        width: 200,
                        height: 200,
                        x: 4,
                        y: 120,
                        fill: 'red',
                        radius: 20
                    },
                    {
                                width: 100,
                                height: 200,
                                x: 3,
                                y: 100,
                                fill: 'red',
                                radius: 20
                            }
          ];
    return (
        <Mundo
          rects= {rects}
        />
    );
  }
}

export default App;
